import{_ as o,o as r,c as d,a as e,b as s,w as t,d as a,e as h,r as n}from"./app.7be90a11.js";const l={},c=e("h1",{id:"\u1106\u116E\u11AB\u110C\u1166-\u1112\u1162\u1100\u1167\u11AF",tabindex:"-1"},[e("a",{class:"header-anchor",href:"#\u1106\u116E\u11AB\u110C\u1166-\u1112\u1162\u1100\u1167\u11AF","aria-hidden":"true"},"#"),a(" \uBB38\uC81C \uD574\uACB0")],-1),u={class:"custom-container tip"},p=e("i",{class:"fas fa-info"},null,-1),_=a("\uC790\uC8FC \uBB3B\uB294 \uC9C8\uBB38"),f=a("\uC758 \uB0B4\uC6A9\uB3C4 \uAC19\uC774 \uCC38\uACE0\uD558\uC2DC\uBA74 \uC88B\uC2B5\uB2C8\uB2E4."),k=h('<p>\uBB38\uC81C\uAC00 \uBC1C\uC0DD\uD558\uC600\uC744 \uB54C, \uBA3C\uC800 \uC774 \uBB38\uC11C\uB97C \uCC38\uACE0\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624. \uD574\uB2F9\uD558\uB294 \uD56D\uBAA9\uC774 \uC5C6\uAC70\uB098, \uC774 \uBB38\uC11C\uC5D0\uC11C \uC9C0\uC2DC\uD558\uB294 \uB300\uB85C \uC2E4\uD589\uD568\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uD574\uACB0\uB418\uC9C0 \uC54A\uC744 \uB54C\uC5D0\uB294 \uC11C\uBC84 \uAD00\uB9AC\uC790\uC5D0\uAC8C \uBB38\uC758\uD558\uAC70\uB098 \uBC84\uADF8\uB97C \uC2E0\uACE0\uD574 \uC8FC\uC2ED\uC2DC\uC624.</p><h2 id="\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u110F\u1167\u110C\u1175\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u110F\u1167\u110C\u1175\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" aria-hidden="true">#</a> \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uAC00 \uCF1C\uC9C0\uC9C0 \uC54A\uC544\uC694!</h2><p>\uB300\uBD80\uBD84\uC758 \uACBD\uC6B0, \uC0AC\uC6A9\uD558\uC2DC\uB294 \uBE0C\uB77C\uC6B0\uC800 \uB610\uB294 \uC6B4\uC601\uCCB4\uC81C\uAC00 \uC624\uB798\uB418\uC5C8\uC744 \uACBD\uC6B0 \uB098\uD0C0\uB098\uB294 \uD604\uC0C1\uC785\uB2C8\uB2E4. \uBE0C\uB77C\uC6B0\uC800 \uBC0F \uC6B4\uC601\uCCB4\uC81C\uB97C \uCD5C\uC2E0 \uBC84\uC804\uC73C\uB85C \uC5C5\uB370\uC774\uD2B8\uD55C \uB4A4, \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624.</p><p>\uADF8\uB7FC\uC5D0\uB3C4 \uC2E4\uD589\uB418\uC9C0 \uC54A\uC744 \uACBD\uC6B0, \uB0AE\uC740 \uD655\uB960\uB85C \uBE0C\uB77C\uC6B0\uC800 \uCE90\uC2DC \uBB38\uC81C\uC77C \uAC00\uB2A5\uC131\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uBE0C\uB77C\uC6B0\uC800\uC758 \uCE90\uC2DC\uB97C \uCD08\uAE30\uD654\uD55C \uB4A4, \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624.</p><h2 id="\u1111\u1166\u110B\u1175\u110C\u1175\u1105\u1173\u11AF-\u1107\u116E\u11AF\u1105\u1165\u110B\u1169\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u110B\u1165\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u1111\u1166\u110B\u1175\u110C\u1175\u1105\u1173\u11AF-\u1107\u116E\u11AF\u1105\u1165\u110B\u1169\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u110B\u1165\u110B\u116D" aria-hidden="true">#</a> \uD398\uC774\uC9C0\uB97C \uBD88\uB7EC\uC62C \uC218 \uC5C6\uC5B4\uC694!</h2><p>\uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uB294 \uCF1C\uC9C0\uC9C0\uB9CC \uD398\uC774\uC9C0\uB97C \uBD88\uB7EC\uC62C \uC218 \uC5C6\uB2E4\uB294 \uC624\uB958 \uBA54\uC2DC\uC9C0\uAC00 \uB098\uC628\uB2E4\uBA74, \uB124\uD2B8\uC6CC\uD06C\uC5D0 \uBB38\uC81C\uAC00 \uC5C6\uB294 \uC9C0 \uBA3C\uC800 \uD655\uC778\uD574 \uC8FC\uC2ED\uC2DC\uC624. \uB610\uD55C \uB2E4\uB978 \uAE30\uAE30\uB85C\uB3C4 \uC811\uC18D\uC744 \uC2DC\uB3C4\uD558\uC5EC \uC11C\uBC84\uAC00 \uBA48\uCDB0\uC788\uB294 \uAC83\uC740 \uC544\uB2CC\uC9C0\uB3C4 \uD655\uC778\uD574 \uC8FC\uC2ED\uC2DC\uC624.</p><p>\uB0AE\uC740 \uD655\uB960\uB85C \uBE0C\uB77C\uC6B0\uC800 \uCE90\uC2DC \uBB38\uC81C\uC77C \uAC00\uB2A5\uC131\uC774 \uC788\uC2B5\uB2C8\uB2E4. \uBE0C\uB77C\uC6B0\uC800\uC758 \uCE90\uC2DC\uB97C \uCD08\uAE30\uD654\uD55C \uB4A4, \uB2E4\uC2DC \uC2DC\uB3C4\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624.</p><p>\uADF8\uB7FC\uC5D0\uB3C4 \uC2E4\uD589\uB418\uC9C0 \uC54A\uC744 \uACBD\uC6B0, \uC11C\uBC84\uC758 \uBB38\uC81C\uC77C \uAC00\uB2A5\uC131\uC774 \uC788\uC73C\uBBC0\uB85C \uD574\uB2F9 \uC11C\uBC84\uC758 \uAD00\uB9AC\uC790\uC5D0\uAC8C \uBB38\uC758\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624.</p><h2 id="\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u1106\u1162\u110B\u116E-\u1102\u1173\u1105\u1167\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u1106\u1162\u110B\u116E-\u1102\u1173\u1105\u1167\u110B\u116D" aria-hidden="true">#</a> \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uAC00 \uB9E4\uC6B0 \uB290\uB824\uC694!</h2><p>\uC778\uD130\uB137 \uC11C\uBE44\uC2A4 \uC81C\uACF5\uC790(ISP)\uC758 \uD1B5\uC2E0 \uC7A5\uC5D0\uB098 \uC810\uAC80\uC774 \uC9C4\uD589\uC911\uC778 \uAC83\uC740 \uC544\uB2CC\uC9C0, \uB124\uD2B8\uC6CC\uD06C\uC758 \uD1B5\uC2E0 \uC18D\uB3C4\uB098 \uB124\uD2B8\uC6CC\uD06C \uC124\uC815\uC5D0 \uBB38\uC81C\uAC00 \uC5C6\uB294\uC9C0, \uC11C\uBC84 \uCE21\uC758 \uC7A5\uC560 \uBCF4\uACE0\uB098 \uC810\uAC80 \uC77C\uC815\uC740 \uC5C6\uB294 \uC9C0 \uBA3C\uC800 \uD655\uC778\uD558\uC2ED\uC2DC\uC624.</p><p>1.Misskey \uC6F9 \uC124\uC815 \uBA54\uB274\uC758 &#39;\uC124\uC815&#39;\uC73C\uB85C \uB4E4\uC5B4\uAC00\uC154\uC11C, &#39;\uD074\uB77C\uC774\uC5B8\uD2B8 \uC124\uC815&#39;\uC758 &#39;\uC77C\uBC18&#39;\uC5D0\uC11C \uB2E4\uC74C\uACFC \uAC19\uC774 \uC124\uC815\uD574 \uBCF4\uC2ED\uC2DC\uC624.</p><ul><li>&#39;\uBAA8\uC591&#39;\uC758 &quot;UI\uC758 \uC560\uB2C8\uBA54\uC774\uC158\uC744 \uC904\uC774\uAE30&quot; \uCF1C\uAE30</li><li>&#39;\uBAA8\uC591&#39;\uC758 &quot;\uBAA8\uB2EC\uC5D0 \uD750\uB9BC \uD6A8\uACFC \uC0AC\uC6A9&quot; \uB044\uAE30</li><li>&#39;\uBAA8\uC591&#39;\uC758 &quot;\uC2DC\uC2A4\uD15C \uAE30\uBCF8 \uAE00\uAF34\uC744 \uC0AC\uC6A9&quot; \uCF1C\uAE30</li><li>&#39;\uBAA8\uC591&#39;\uC758 &quot;OS \uAE30\uBCF8 \uC774\uBAA8\uC9C0\uB97C \uC0AC\uC6A9&quot; \uCF1C\uAE30</li></ul><p>\uC544\uB798 \uC124\uC815\uC740 Misskey\uC758 \uAE30\uB2A5\uC744 \uC77C\uBD80 \uBE44\uD65C\uC131\uD654\uD569\uB2C8\uB2E4.</p><ul><li>&#39;\uB3D9\uC791&#39;\uC758 &quot;Pages \uC5D0\uC11C AiScript \uB97C \uC0AC\uC6A9\uD558\uC9C0 \uC54A\uC74C&quot; \uB044\uAE30</li><li>&#39;\uBAA8\uC591&#39;\uC758 &quot;\uC6C0\uC9C1\uC784\uC774 \uC788\uB294 MFM\uC758 \uBE44\uD65C\uC131\uD654&quot; \uCF1C\uAE30</li></ul><p>2.\uC6F9 \uBE0C\uB77C\uC6B0\uC800 \uC124\uC815</p><ul><li>\uBE0C\uB77C\uC6B0\uC800 \uC124\uC815\uC5D0\uC11C \uD558\uB4DC\uC6E8\uC5B4 \uAC00\uC18D\uC744 \uCF1C\uAE30</li><li>\uBE0C\uB77C\uC6B0\uC800\uC758 \uC560\uB4DC\uC628\uC774\uB098 \uD655\uC7A5 \uAE30\uB2A5\uC5D0 \uB300\uD55C \uC124\uC815\uC744 \uC810\uAC80 \uD639\uC740 \uBE44\uD65C\uC131\uD654</li><li>\uAE30\uD0C0 \uBE0C\uB77C\uC6B0\uC800 \uC124\uC815\uC744 \uC810\uAC80</li></ul><p>3.\uAE30\uD0C0</p><ul><li>\uC0AC\uC6A9 \uC911\uC778 \uAE30\uAE30\uC758 \uC2DC\uC2A4\uD15C \uC124\uC815 \uC810\uAC80</li></ul><h2 id="misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u110B\u1175\u1109\u1161\u11BC\u1112\u1162\u110B\u116D-\u1107\u1162\u1100\u1167\u11BC\u110B\u1175-\u1110\u116E\u1106\u1167\u11BC\u1112\u1162\u110C\u1175\u1100\u1165\u1102\u1161-\u1100\u1175\u1110\u1161-\u1106\u116E\u11AB\u110C\u1166" tabindex="-1"><a class="header-anchor" href="#misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u1100\u1161-\u110B\u1175\u1109\u1161\u11BC\u1112\u1162\u110B\u116D-\u1107\u1162\u1100\u1167\u11BC\u110B\u1175-\u1110\u116E\u1106\u1167\u11BC\u1112\u1162\u110C\u1175\u1100\u1165\u1102\u1161-\u1100\u1175\u1110\u1161-\u1106\u116E\u11AB\u110C\u1166" aria-hidden="true">#</a> Misskey \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uAC00 \uC774\uC0C1\uD574\uC694! (\uBC30\uACBD\uC774 \uD22C\uBA85\uD574\uC9C0\uAC70\uB098 \uAE30\uD0C0 \uBB38\uC81C)</h2><p>\uC5C5\uB370\uC774\uD2B8\uB85C \uC778\uD574 UI\uC758 \uBCC0\uACBD \uC0AC\uD56D\uC774 \uBC1C\uC0DD\uD558\uC600\uC744 \uB54C, \uD14C\uB9C8 \uCE90\uC2DC \uC2DC\uC2A4\uD15C\uC758 \uC601\uD5A5\uC73C\uB85C \uD648\uD398\uC774\uC9C0\uAC00 \uC815\uC0C1\uC801\uC73C\uB85C \uD45C\uC2DC\uB418\uC9C0 \uC54A\uC744 \uC218 \uC788\uC2B5\uB2C8\uB2E4. \uC124\uC815 \uBA54\uB274\uC5D0\uC11C &#39;\uCE90\uC2DC \uBE44\uC6B0\uAE30&#39;\uB97C \uD074\uB9AD\uD558\uC5EC \uD574\uACB0\uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><div class="custom-container warning"><i class="fas fa-exclamation"></i><p>&quot;\uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8&quot; \uC124\uC815\uC758 \uCE90\uC2DC \uBE44\uC6B0\uAE30\uC785\uB2C8\uB2E4. &quot;\uBE0C\uB77C\uC6B0\uC800&quot;\uC758 \uCE90\uC2DC\uB97C \uCD08\uAE30\uD654\uD558\uC9C0 \uB9C8\uC2ED\uC2DC\uC624.</p></div><h2 id="\u110B\u1161\u11AF\u1105\u1175\u11B7\u110B\u1175\u1102\u1161-\u110B\u1161\u11AB\u1110\u1166\u1102\u1161\u110B\u1174-\u1101\u1161\u11B7\u1108\u1161\u11A8\u110B\u1175\u11B7-\u1111\u116D\u1109\u1175\u1100\u1161-\u1109\u1161\u1105\u1161\u110C\u1175\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u110B\u1161\u11AF\u1105\u1175\u11B7\u110B\u1175\u1102\u1161-\u110B\u1161\u11AB\u1110\u1166\u1102\u1161\u110B\u1174-\u1101\u1161\u11B7\u1108\u1161\u11A8\u110B\u1175\u11B7-\u1111\u116D\u1109\u1175\u1100\u1161-\u1109\u1161\u1105\u1161\u110C\u1175\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" aria-hidden="true">#</a> \uC54C\uB9BC\uC774\uB098 \uC548\uD14C\uB098\uC758 \uAE5C\uBE61\uC784 \uD45C\uC2DC\uAC00 \uC0AC\uB77C\uC9C0\uC9C0 \uC54A\uC544\uC694!</h2><p>\uAE5C\uBE61\uC784 \uD45C\uC2DC\uB294 \uC77D\uC9C0 \uC54A\uC740 \uCEE8\uD150\uCE20\uAC00 \uC788\uC744 \uB54C\uC5D0 \uB098\uD0C0\uB0A9\uB2C8\uB2E4. \uAE5C\uBE61\uC784 \uD45C\uC2DC\uAC00 \uC0AC\uB77C\uC9C0\uC9C0 \uC54A\uB294 \uD604\uC0C1\uC740 \uBCF4\uD1B5 \uC77D\uC9C0 \uC54A\uC740 \uCEE8\uD150\uCE20\uAC00 \uBAA9\uB85D \uC5B4\uB518\uAC00\uC5D0 \uC874\uC7AC\uD558\uAE30 \uB54C\uBB38\uC5D0 \uB098\uD0C0\uB0A9\uB2C8\uB2E4. \uBAA8\uB4E0 \uCEE8\uD150\uCE20\uB97C \uC77D\uC740 \uAC83 \uAC19\uC740\uB370\uB3C4 \uC0AC\uB77C\uC9C0\uC9C0 \uC54A\uB294\uB2E4\uBA74 (\uBC84\uADF8\uC77C \uAC00\uB2A5\uC131\uC774 \uC788\uC2B5\uB2C8\uB2E4), \uC124\uC815 - \uC54C\uB9BC\uC5D0\uC11C \uBAA8\uB4E0 \uC54C\uB9BC/\uAE00/\uB300\uD654\uB97C \uC77D\uC740 \uC0C1\uD0DC\uB85C \uD45C\uC2DC\uD558\uB3C4\uB85D \uD560 \uC218 \uC788\uC2B5\uB2C8\uB2E4.</p><h2 id="\u1105\u1175\u1102\u1169\u1110\u1173\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u110B\u1165\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#\u1105\u1175\u1102\u1169\u1110\u1173\u1112\u1161\u11AF-\u1109\u116E-\u110B\u1165\u11B9\u110B\u1165\u110B\u116D" aria-hidden="true">#</a> \uB9AC\uB178\uD2B8\uD560 \uC218 \uC5C6\uC5B4\uC694!</h2><p>\uACF5\uAC1C \uBC94\uC704\uAC00 &#39;\uD314\uB85C\uC6CC&#39;\uC774\uAC70\uB098 &#39;\uB2E4\uC774\uB809\uD2B8&#39;\uC778 \uAC8C\uC2DC\uBB3C\uC740 \uB9AC\uB178\uD2B8\uD560 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4.</p><h2 id="misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u110B\u1166\u1109\u1165-\u1110\u1173\u11A8\u110C\u1165\u11BC-\u110B\u116D\u1109\u1169\u1100\u1161-\u1111\u116D\u1109\u1175\u1103\u116C\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u110B\u1166\u1109\u1165-\u1110\u1173\u11A8\u110C\u1165\u11BC-\u110B\u116D\u1109\u1169\u1100\u1161-\u1111\u116D\u1109\u1175\u1103\u116C\u110C\u1175-\u110B\u1161\u11AD\u110B\u1161\u110B\u116D" aria-hidden="true">#</a> Misskey \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uC5D0\uC11C \uD2B9\uC815 \uC694\uC18C\uAC00 \uD45C\uC2DC\uB418\uC9C0 \uC54A\uC544\uC694!</h2><p>\uC6F9 \uBE0C\uB77C\uC6B0\uC800\uC758 \uAD11\uACE0 \uCC28\uB2E8\uAE30\uC640 \uAC19\uC740 \uC560\uB4DC\uC628 \uB610\uB294 \uD655\uC7A5 \uAE30\uB2A5\uC5D0 \uC758\uD574 \uBC1C\uC0DD\uD558\uB294 \uBB38\uC81C\uC77C \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4. \uC560\uB4DC\uC628 \uB610\uB294 \uD655\uC7A5 \uAE30\uB2A5\uC758 \uC124\uC815\uC744 \uC810\uAC80\uD558\uAC70\uB098, \uBE44\uD65C\uC131\uD654\uD558\uC5EC \uC8FC\uC2ED\uC2DC\uC624.</p><h2 id="misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u110B\u1166-\u1107\u1165\u11AB\u110B\u1167\u11A8\u1103\u116C\u110C\u1175-\u110B\u1161\u11AD\u110B\u1173\u11AB-\u1107\u116E\u1107\u116E\u11AB\u110B\u1175-\u110B\u1175\u11BB\u110B\u1165\u110B\u116D" tabindex="-1"><a class="header-anchor" href="#misskey-\u110B\u1170\u11B8-\u110F\u1173\u11AF\u1105\u1161\u110B\u1175\u110B\u1165\u11AB\u1110\u1173\u110B\u1166-\u1107\u1165\u11AB\u110B\u1167\u11A8\u1103\u116C\u110C\u1175-\u110B\u1161\u11AD\u110B\u1173\u11AB-\u1107\u116E\u1107\u116E\u11AB\u110B\u1175-\u110B\u1175\u11BB\u110B\u1165\u110B\u116D" aria-hidden="true">#</a> Misskey \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uC5D0 \uBC88\uC5ED\uB418\uC9C0 \uC54A\uC740 \uBD80\uBD84\uC774 \uC788\uC5B4\uC694!</h2><p>\uB300\uBD80\uBD84\uC758 \uACBD\uC6B0 Misskey \uC6F9 \uD074\uB77C\uC774\uC5B8\uD2B8\uC758 \uBC88\uC5ED\uC774 \uC81C\uB54C \uC774\uB8E8\uC5B4\uC9C0\uC9C0 \uC54A\uC740 \uAC83\uC774 \uC6D0\uC778\uC774\uBBC0\uB85C, \uBC84\uADF8\uAC00 \uC544\uB2D9\uB2C8\uB2E4. \uBD88\uD3B8\uD558\uC2DC\uACA0\uC9C0\uB9CC \uBC88\uC5ED\uC774 \uC644\uC131\uB420 \uB54C\uAE4C\uC9C0 \uAE30\uB2E4\uB824 \uC8FC\uC2ED\uC2DC\uC624.</p>',29),m=a("\uB9CC\uC57D Misskey\uC758 \uBC88\uC5ED\uC5D0 \uAD00\uC2EC\uC774 \uC788\uC73C\uC2DC\uB2E4\uBA74 \uC9C1\uC811 "),q=a("\uBC88\uC5ED\uC5D0 \uCC38\uAC00"),x=a("\uD558\uC2E4 \uC218\uB3C4 \uC788\uC2B5\uB2C8\uB2E4.");function y(b,M){const i=n("RouterLink");return r(),d("div",null,[c,e("div",u,[p,e("p",null,[s(i,{to:"/ko/docs/faq.html"},{default:t(()=>[_]),_:1}),f])]),k,e("p",null,[m,s(i,{to:"/ko/docs/misskey.html"},{default:t(()=>[q]),_:1}),x])])}var g=o(l,[["render",y],["__file","troubleshooting.html.vue"]]);export{g as default};
